         <h1>Innovation happens when both our team and our clients can grow and thrive.</h1>
         <p class="about-1-para">An object in motion stays in motion unless acted on by an outside force, right? Well there’s a lesser known saying that’s equally as important and earth-shattering:</p>
         <br>
         <p class="definition"><span class="definition__container">Designers in motion stay in motion.<button type="button">*</button></span><br>And we’re in motion, baby. No signs of stopping.</p>
         <br>
         <p class="about-1-para">We're constantly in motion, testing, pivoting and adapting to the pace of the industry and the needs of our clients and users.</p>
