                  <h1>Indicius</h1>
                  <p class="subtitle"><i>[In-dee-see-US]</i> <b>noun.</b></p>
                  <br>
                  <p>In Spanish, the word “indicio” refers to a sign, hint, or suggestion. It suggests that something’s about to happen.</p>
                  <br> 
                  <p>We came up with the name "Indicius" while surrounded by a group of friends. It's only appropriate that that's who we are. A group of friends who care about human-centered design (some of our clients say "a family").</p>
